8	corse	Corse	2019-03-22 14:57:36.387708+01	2019-03-22 14:57:36.387729+01	0101000020E610000011E4A08499062240F775E09C11054540	La Corse ou « la montagne dans la mer » dispose de peu de surface agricole compte tenu de son relief accidenté. Elle tire néanmoins avantage de ses particularités en conférant une forte identité à de nombreux produits et en ayant joué la carte de la qualité.  Des produits de charcuterie comme la Coppa, le Jambon sec et le Lonzo bénéficient d’une AOC.  C’est également le cas pour le vin Corse, le fromage Brocciu, le miel, la farine de châtaigne, l’huile d’olive. La quasi-totalité des agrumes français est récoltée en Corse et les clémentines bénéficient d’une Indication Géographique Protégée (IGP). Autre preuve de l’engagement des agriculteurs corses pour le respect de l’environnement, l’agriculture biologique connaît une forte progression dans la région.	0
